import React from "react";
import styled from "styled-components";

const Container = styled.div`
  padding: 16px;
  border: 2px solid #3E2723;
  border-radius: 2px;

  &::before {
    content: "";
    position: absolute;
    top: 0;
    left: 0;
    width: 90%;
    border-radius: 2px 0;
  }
`;

